import React from 'react'

function channel() {
    return (
        <div className='container_pages_app'>
            <LeftSidebar/>
            <div className="container2_pages_app">
              <div className='navigation_Home'>
                {
                  NavList.map(m=>{
                    return(
                    <p key={m} className='btn_nav_home'>
                      {m}
                    </p>)
                    
                  })
                }
              </div>
                <ShowVideoGrid vids={vids}/>
            </div>
        
        </div>
      )
}

export default channel
